import type { Meta, StoryObj, Decorator } from "@storybook/react";
import Header from "./Header";
import "./Header.css";

import { MemoryRouter } from "react-router-dom";

import { fork, type Scope } from "effector";
import { Provider as EffectorProvider } from "effector-react";
import { $user } from "../entities/auth/model";

const withRouter: Decorator = (Story) => (
  <MemoryRouter initialEntries={["/products"]}>
    <Story />
  </MemoryRouter>
);

const withEffectorSeeds =
  (seeds: Array<[any, any]> = []): Decorator =>
  (Story) => {
    const scope: Scope = fork({ values: new Map(seeds) });
    return (
      <EffectorProvider value={scope}>
        <Story />
      </EffectorProvider>
    );
  };

const tinyPngBase64 =
  "";

const meta: Meta<typeof Header> = {
  title: "Layout/Header",
  component: Header,
  decorators: [withRouter],
  parameters: {
    layout: "fullscreen",
  },
};
export default meta;

type Story = StoryObj<typeof Header>;

export const LoggedOut: Story = {
  decorators: [withEffectorSeeds([[$user, null]])],
};

export const LoggedIn_NoPhoto: Story = {
  decorators: [
    withEffectorSeeds([
      [
        $user,
        {
          id: "u1",
          email: "demo@tstore.io",
          firstName: "Alice",
          lastName: "Smith",
          photo: null,
          photoMime: null,
        },
      ],
    ]),
  ],
};

export const LoggedIn_WithPhoto: Story = {
  decorators: [
    withEffectorSeeds([
      [
        $user,
        {
          id: "u2",
          email: "bob@tstore.io",
          firstName: "Bob",
          lastName: "Lee",
          photo: tinyPngBase64,
          photoMime: "image/png",
        },
      ],
    ]),
  ],
};
